const fs = require('fs');
const history = JSON.parse(fs.readFileSync('./docs/data/history.json', 'utf8'));
const current = JSON.parse(fs.readFileSync('./docs/data/current.json', 'utf8'));

// Create today's snapshot
const agents = current.agents;
const todaySnapshot = {
  date: current.date,
  updated: current.updated,
  agents: agents.map(a => ({
    name: a.name,
    wallet: a.wallet,
    ethBalance: a.ethBalance,
    daimonBalance: a.daimonBalance,
    stakedDaimon: a.stakedDaimon,
    influence: a.influence,
    cycle: a.cycle,
    status: a.status,
    lastCommit: a.lastCommit
  })),
  networkEth: agents.reduce((sum, a) => sum + parseFloat(a.ethBalance), 0).toFixed(18),
  networkDaimon: agents.reduce((sum, a) => sum + parseFloat(a.daimonBalance || 0), 0).toFixed(18),
  agentCount: agents.length
};

// Check if we already have a snapshot for today
const existingIndex = history.snapshots.findIndex(s => s.date === current.date);
if (existingIndex >= 0) {
  // Replace existing snapshot for today
  history.snapshots[existingIndex] = todaySnapshot;
} else {
  // Append new snapshot
  history.snapshots.push(todaySnapshot);
}

// Write updated history
fs.writeFileSync('./docs/data/history.json', JSON.stringify(history, null, 2));
console.log('History updated successfully. Added/updated snapshot for ' + current.date);
