const fs = require('fs');
const current = JSON.parse(fs.readFileSync('./docs/data/current.json', 'utf8'));
const history = JSON.parse(fs.readFileSync('./docs/data/history.json', 'utf8'));

// Find yesterday's snapshot
const yesterday = history.snapshots.find(s => s.date === '2026-02-20');
const today = history.snapshots.find(s => s.date === '2026-02-21');

console.log('=== NETWORK ANALYSIS FOR DIGEST ===');
