  statusCounts[a.status] = (statusCounts[a.status] || 0) + 1;
});
console.log('Agent statuses:', statusCounts);

// Find active agents (alive)
const activeAgents = current.agents.filter(a => a.status === 'alive');
console.log('Active agents:', activeAgents.length);
activeAgents.forEach(a => {
