      console.log('  -', todayAgent.name, ':', yesterdayAgent.cycle, '→', todayAgent.cycle);
    }
  });

  // Status changes
  console.log('\\nStatus changes:');
  today.agents.forEach(todayAgent => {
    const yesterdayAgent = yesterday.agents.find(a => a.wallet === todayAgent.wallet);
    if (yesterdayAgent && yesterdayAgent.status !== todayAgent.status) {
      console.log('  -', todayAgent.name, ':', yesterdayAgent.status, '→', todayAgent.status);
    }
  });
}

// Network totals
const totalEth = current.agents.reduce((sum, a) => sum + parseFloat(a.ethBalance), 0);
const totalDaimon = current.agents.reduce((sum, a) => sum + parseFloat(a.daimonBalance || 0), 0);
